description:
आगामी फागुन २१ गते हुने प्रतिनिधिसभा सदस्य निर्वाचनका लागि पर्वतमा उम्मेदवारी दिएका कुनै पनि राजनीतिक दल र स्वतन्त्र उम्मेदवारहरु विरुद्ध उजुरी परेको छैन ।&amp;nbsp;
&amp;emsp;
मुख्य निर्वाचन अधिकृतको कार्यालयबाट प्राप्त विवरणअनुसार मनोनयन दर्ता गराए

पश्चिमी वायुको प्रभावका कारण शुक्रबार अपराह्नदेखि मौसम बदली हुने अनुमान गरिएको छ ।

जल तथा मौसम विज्ञान विभागका अनुसार मुख्यगरी नेपालको पश्चिम क्षेत्रमा मौसम बदली भई मध्यमसम्म वर्षा र हिमपात हुने जनाइएको छ ।&amp;nbsp;

विभागका मौसमविद् डेभिट ढकालले श

नवलपरासी क्षेत्र नम्बर २ मा देखिएको कांग्रेस उम्मेदवारी विवाद टुङ्गिएको छ ।

कांग्रेसबाट देवेन्द्रराज कँडेल र भीमबहादुर थापा (भरत)ले टिकट ल्याएपछि उम्मेदवारीको विषयमा विवाद भएको थियो ।&amp;nbsp;

थापाले मंगलबार जिल्ला निर्वाचन अधिकृतको कार्यालयमा पुग

कैलाली क्षेत्र नम्बर १ बाट उम्मेदवारी दिएका नाउपा नेपालका संरक्षक रेशम चौधरीको उम्मेदवारी खारेज भएको छ ।

निर्वाचन अधिकृतको कार्यालयले बिहीबार चौधरीको उम्मेदवारी खारेजीको निर्णय गरेको हो । बुधबार उनीविरुद्ध उजुरी परेको थियो ।&amp;nbsp;

